BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `users` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`name`	varchar,
	`email`	varchar,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL,
	`password_digest`	varchar,
	`admin`	boolean DEFAULT 'f',
	`student`	boolean DEFAULT 't',
	`profile_owner_type`	varchar,
	`profile_owner_id`	integer
);
CREATE TABLE IF NOT EXISTS `teams` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`name`	varchar NOT NULL,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `teachers` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`name`	varchar NOT NULL,
	`title`	varchar NOT NULL,
	`hiring_date`	date NOT NULL,
	`department_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL,
	CONSTRAINT `fk_rails_4a0b45f8c3` FOREIGN KEY(`department_id`) REFERENCES `departments`(`id`)
);
CREATE TABLE IF NOT EXISTS `teacher_interests` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`field`	varchar NOT NULL,
	`teacher_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `teacher_degrees` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`title`	varchar NOT NULL,
	`date_awarded`	date NOT NULL,
	`university`	varchar NOT NULL,
	`field`	varchar NOT NULL,
	`teacher_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `teacher_courses` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`course_id`	integer,
	`teacher_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL,
	`date_taught`	date NOT NULL DEFAULT '2017-11-11'
);
CREATE TABLE IF NOT EXISTS `students` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`section_number`	integer NOT NULL,
	`bench_number`	integer NOT NULL,
	`name`	varchar NOT NULL,
	`gender`	varchar NOT NULL,
	`year`	integer NOT NULL,
	`phone_number`	integer NOT NULL,
	`address`	varchar NOT NULL,
	`birth_date`	date NOT NULL,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `student_teams` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`student_id`	integer,
	`team_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `student_courseworks` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`mark`	float NOT NULL,
	`coursework_id`	integer DEFAULT NULL,
	`student_id`	integer DEFAULT NULL,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL,
	`date_handed`	date,
	`solution`	varchar
);
CREATE TABLE IF NOT EXISTS `student_course_enrollments` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`status`	varchar NOT NULL,
	`course_id`	integer,
	`student_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `schema_migrations` (
	`version`	varchar NOT NULL,
	PRIMARY KEY(`version`)
);
CREATE TABLE IF NOT EXISTS `messages` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`content`	varchar,
	`sender_id`	integer,
	`receiver_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `lectures` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`place`	varchar NOT NULL,
	`lec_time`	datetime NOT NULL,
	`note`	varchar,
	`teacher_id`	integer,
	`course_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `friendships` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`friendable_type`	varchar DEFAULT NULL,
	`friendable_id`	integer DEFAULT NULL,
	`friend_id`	integer DEFAULT NULL,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL,
	`blocker_id`	integer DEFAULT NULL,
	`status`	integer DEFAULT NULL
);
CREATE TABLE IF NOT EXISTS `enrollments` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`degree`	varchar,
	`student_id`	integer,
	`department_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `employees` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`name`	varchar NOT NULL,
	`position`	varchar NOT NULL,
	`hiring_date`	date NOT NULL,
	`department_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL,
	CONSTRAINT `fk_rails_0025f65a97` FOREIGN KEY(`department_id`) REFERENCES `departments`(`id`)
);
CREATE TABLE IF NOT EXISTS `departments` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`name`	varchar,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL,
	`abbreviation`	varchar
);
CREATE TABLE IF NOT EXISTS `courseworks` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`date_due`	date NOT NULL,
	`date_assigned`	date NOT NULL,
	`description`	varchar NOT NULL,
	`weight`	float NOT NULL,
	`total_mark`	integer NOT NULL,
	`title`	varchar NOT NULL,
	`course_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `courses` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`code`	varchar NOT NULL,
	`title`	varchar NOT NULL,
	`credit_hours`	integer NOT NULL,
	`total_mark`	integer NOT NULL,
	`department_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `course_notes` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`title`	varchar NOT NULL,
	`content`	varchar NOT NULL,
	`course_id`	integer,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL
);
CREATE TABLE IF NOT EXISTS `ar_internal_metadata` (
	`key`	varchar NOT NULL,
	`value`	varchar,
	`created_at`	datetime NOT NULL,
	`updated_at`	datetime NOT NULL,
	PRIMARY KEY(`key`)
);
CREATE INDEX IF NOT EXISTS `index_users_on_profile_owner_type_and_profile_owner_id` ON `users` (
	`profile_owner_type`,
	`profile_owner_id`
);
CREATE UNIQUE INDEX IF NOT EXISTS `index_users_on_email` ON `users` (
	`email`
);
CREATE INDEX IF NOT EXISTS `index_teachers_on_department_id` ON `teachers` (
	`department_id`
);
CREATE INDEX IF NOT EXISTS `index_teacher_interests_on_teacher_id` ON `teacher_interests` (
	`teacher_id`
);
CREATE INDEX IF NOT EXISTS `index_teacher_degrees_on_teacher_id` ON `teacher_degrees` (
	`teacher_id`
);
CREATE INDEX IF NOT EXISTS `index_teacher_courses_on_teacher_id` ON `teacher_courses` (
	`teacher_id`
);
CREATE INDEX IF NOT EXISTS `index_teacher_courses_on_course_id` ON `teacher_courses` (
	`course_id`
);
CREATE INDEX IF NOT EXISTS `index_student_teams_on_team_id` ON `student_teams` (
	`team_id`
);
CREATE INDEX IF NOT EXISTS `index_student_teams_on_student_id` ON `student_teams` (
	`student_id`
);
CREATE INDEX IF NOT EXISTS `index_student_courseworks_on_student_id` ON `student_courseworks` (
	`student_id`
);
CREATE UNIQUE INDEX IF NOT EXISTS `index_student_courseworks_on_coursework_id_and_student_id` ON `student_courseworks` (
	`coursework_id`,
	`student_id`
);
CREATE INDEX IF NOT EXISTS `index_student_courseworks_on_coursework_id` ON `student_courseworks` (
	`coursework_id`
);
CREATE INDEX IF NOT EXISTS `index_student_course_enrollments_on_student_id` ON `student_course_enrollments` (
	`student_id`
);
CREATE UNIQUE INDEX IF NOT EXISTS `index_student_course_enrollments_on_course_id_and_student_id` ON `student_course_enrollments` (
	`course_id`,
	`student_id`
);
CREATE INDEX IF NOT EXISTS `index_student_course_enrollments_on_course_id` ON `student_course_enrollments` (
	`course_id`
);
CREATE INDEX IF NOT EXISTS `index_messages_on_sender_id` ON `messages` (
	`sender_id`
);
CREATE INDEX IF NOT EXISTS `index_messages_on_receiver_id` ON `messages` (
	`receiver_id`
);
CREATE INDEX IF NOT EXISTS `index_lectures_on_teacher_id` ON `lectures` (
	`teacher_id`
);
CREATE INDEX IF NOT EXISTS `index_lectures_on_course_id` ON `lectures` (
	`course_id`
);
CREATE INDEX IF NOT EXISTS `index_friendships_on_friendable_type_and_friendable_id` ON `friendships` (
	`friendable_type`,
	`friendable_id`
);
CREATE INDEX IF NOT EXISTS `index_enrollments_on_student_id` ON `enrollments` (
	`student_id`
);
CREATE INDEX IF NOT EXISTS `index_enrollments_on_department_id` ON `enrollments` (
	`department_id`
);
CREATE INDEX IF NOT EXISTS `index_employees_on_department_id` ON `employees` (
	`department_id`
);
CREATE INDEX IF NOT EXISTS `index_courseworks_on_course_id` ON `courseworks` (
	`course_id`
);
CREATE INDEX IF NOT EXISTS `index_courses_on_department_id` ON `courses` (
	`department_id`
);
CREATE INDEX IF NOT EXISTS `index_course_notes_on_course_id` ON `course_notes` (
	`course_id`
);
COMMIT;
