INSERT INTO `course_notes` VALUES (1,'The Fire of Balerion the Black','Balerion, called the Black Dread, was one of the three great dragons of Aegon I Targaryen and his sisters, that were used to conquer much of Westeros during the War of Conquest. Balerion died of old age[2] in 94 AC during the reign of King Jaehaerys I Targaryen, around two hundred years old.',2,'2017-12-18 05:11:07.583584','2017-12-18 05:14:38.591411');
INSERT INTO `course_notes` VALUES (2,'Maegor I Targaryen','Maegor I Targaryen, also known as Maegor the Cruel, was the third Targaryen king to sit the Iron Throne. He was the son of King Aegon I Targaryen and his elder sister-wife, Queen Visenya Targaryen. He had an older half-brother, Aenys I Targaryen.',2,'2017-12-18 05:11:57.233202','2017-12-18 05:11:57.233202');
